INSERT INTO `web_articles` (`id`, `name`, `article`, `order_article`, `active`, `show_title`, `created`, `updated`, `image`, `type`, `link`) VALUES
(1, 'Pro Home', '<h3 style="text-align: center;">Nabízíme dva druhy bezdrátových reprosoustav.</h3>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-6">\n<div class="content">\n<p style="text-align: center;"><img src="/www/front/kcfinder-images/image-inline/Wifi.png" style="width: 137px; height: 60px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-6">\n<div class="content">\n<p style="text-align: center;">​​​​​​<img src="/www/front/kcfinder-images/image-inline/bluetooth.png" style="width: 256px; height: 60px;" /></p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-6">\n<div class="content">\n<h3 style="text-align: center;">WiFi reprosoustavy</h3>\n\n<p style="text-align: center;">Streamujte audio z online hudebních serverů jako je&nbsp;&nbsp;Spotify, Tidal,&nbsp;TuneIn apod.<br />\nOvládejte je přes aplikaci, používejte wifi předvoleb.<br />\nMusíte-li opustit místnost, reproduktor nepřeruší přehrávání, není potřeba ho zase párovat.<br />\nVšechny&nbsp;WiFi reprosoustavy mají také&nbsp;Bluetooth.</p>\n</div>\n</div>\n\n<div class="col col-md-6">\n<div class="content">\n<h3 style="text-align: center;">Bluetooth reprosoustavy</h3>\n\n<p style="text-align: center;">Tyto reprosoustavy využívají pouze technologie Bluetooth, která umožní přímé spojení&nbsp;vysílače &nbsp;<br />\ns reprosoustavami.<br />\nVysílač (telefon, tablet apod.) musí&nbsp;být poblíž reproduktoru.<br />\nOpustíte-li s telefonem místnost, hudba přestane hrát.</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h3 style="text-align: center;">Všechny reproduktory mají také vstup pro drátové připojení s&nbsp;3.5 mm Jack.</h3>\n\n<h3 style="text-align: center;">&nbsp;</h3>\n', 10, 1, 0, '2021-07-21 13:51:49', '2021-07-21 13:51:49', NULL, 1, NULL),
(2, 'Nová generace wifi reproduktorů je tady', '', 20, 1, 0, '2021-07-21 13:57:35', '2021-07-21 13:57:35', 'article-img/2_16285989740219.jpg', 2, NULL),
(3, 'C10 MII', '<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-8">\n<div class="content">\n<p><img alt="" src="/www/front/kcfinder-images/image-inline/bezdratovy.jpg" style="width: 950px; height: 551px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">&nbsp;</h3>\n\n<h3 style="text-align: center;">&nbsp;</h3>\n\n<h3 style="text-align: center;">První reproduktor v naší nabídce.</h3>\n\n<h3 style="text-align: center;"><br />\nC10 MKII</h3>\n\n<p style="text-align: center;"><img src="/www/front/kcfinder-images/image-inline/wireless-multiroom-speaker-C10MkII-airplay2-google-cast-chromecast-AudioPro-black%402x-350x175.png" style="width: 300px; height: 150px;" /></p>\n\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;"><a href="http://www56.webrex.cz/product/51-c10mkii-cerna"><img alt="" src="/www/front/kcfinder-images/image-inline/cena.png" style="width: 110px; height: 69px;" /></a></p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img src="/www/front/kcfinder-images/image-inline/HOME-airplay2.png" style="width: 243px; height: 50px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img src="/www/front/kcfinder-images/image-inline/HOME-ap-multiroom.png" style="width: 147px; height: 50px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/Chromecast-built-in-logo-stacked-primary.png" style="width: 237px; height: 50px;" /></p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;">Přehrávejte libovolnou hudbu z jakékoliv aplikace vašeho iOS zařízení.<br />\nPřehrávejte na několika reproduktorech současně, ať už jsou vybaveny&nbsp;&nbsp;AirPlay 2 nebo ne.</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;">Všechny výhody Audio Pro se naplno projeví při multiroom provozu.<br />\nJen tehdy můžete ocenit výhody a vlastnosti wifi předvoleb.</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;">400+ audio streamingových aplikací.<br />\nPodporuje obojí&nbsp;Android- &amp; iOS zařízení.<br />\nMAC &amp; PC podpora.</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h3 style="text-align: center;">Vaše starší i nové modely Audio Pro mohou využívat multiroomových vlastností.</h3>\n\n<p style="text-align: center;">Ovšem jen pokud je&nbsp;chcete používat.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 30, 1, 0, '2021-07-21 14:00:44', '2021-07-21 14:00:44', NULL, 1, NULL),
(4, 'Video', '<h3 style="text-align: center;">&nbsp;</h3>\n\n<h3 style="text-align: center;">Poslouchejte hudbu po celém domě.<br />\n&nbsp;</h3>\n\n<h3 style="text-align: center;">Hrejte jen z jednoho nebo ze všech reproduktorů.<br />\n&nbsp;</h3>\n\n<h3 style="text-align: center;">Poslouchejte různé&nbsp;zdroje signálu na různých reproduktorech.<br />\n&nbsp;</h3>\n\n<h3 style="text-align: center;">Vytvořte si skupiny.</h3>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><iframe allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen="" frameborder="0" height="800" scrolling="no" src="https://www.youtube.com/embed/aKhN_iKbdfw" title="YouTube video player" width="1420"></iframe></p>\n\n<p>&nbsp;</p>\n\n<h3 style="text-align: center;">Vytvořte si multiroom skupiny v libovolné z těchto aplikací.</h3>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/HOME-apple-home-app.png" style="width: 150px; height: 123px;" /><br />\nG10 / C10 MkII pouze</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/HOME-audiopro-app.png" style="width: 150px; height: 123px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/HOME-Google-home-app.png" style="width: 150px; height: 123px;" /><br />\nG10 / C10 MkII pouze<br />\n&nbsp;</p>\n</div>\n</div>\n</div>\n\n<div class="row row-2">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><a href="https://apps.apple.com/us/app/home/id1110145103" target="_blank"><img alt="" src="/www/front/kcfinder-images/image-inline/HOME-apple-store.png" style="width: 180px; height: 58px;" />