(7, 'Video 2', '<h3 style="text-align: center;">&nbsp;</h3>\n\n<h3 style="text-align: center;">&nbsp;</h3>\n\n<h3 style="text-align: center;">Připojte vaše starší zařízení jako je gramofon, kazeťák nebo CD přehrávač.&nbsp;Poslouchete svou hudbu díky multiroomu po celém domě.</h3>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><iframe allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen="" frameborder="0" height="800" scrolling="no" src="https://www.youtube.com/embed/KktgLmy0AwA" title="YouTube video player" width="1420"></iframe></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 70, 1, 0, '2021-07-21 14:19:17', '2021-07-21 14:19:17', NULL, 1, NULL),
