(11, 'Video 3', '<h3 style="text-align: center;">&nbsp;</h3>\n\n<h3 style="text-align: center;">&nbsp;</h3>\n\n<h3 style="text-align: center;">Vytvořte si vlastní wifi předvolby. Vaše oblíbené stanice, playlist na Spotify apod.<br />\n<br />\nPři přehrávání podržte předvolbu na 3 vteřiny a volba je uložena .<br />\n<br />\nTak jednoduché to je.<br />\n<br />\nJen stisknout tlačítko.</h3>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><iframe allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen="" frameborder="0" height="800" scrolling="no" src="https://www.youtube.com/embed/KyPR5kMhESg" title="YouTube video player" width="1420"></iframe></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-9">\n<div class="content">\n<p><img alt="" src="/www/front/kcfinder-images/image-inline/app(2).jpg" style="width: 1100px; height: 332px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-3">\n<div class="content">\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/HOME-audiopro-app.png" style="width: 120px; height: 98px;" /></p>\n\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;"><a href="https://play.google.com/store/apps/details?id=com.wifiaudio.AudioPro" target="_blank"><img alt="" src="/www/front/kcfinder-images/image-inline/HOME-google-play.png" style="width: 150px; height: 45px;" /></a></p>\n\n<p style="text-align: center;"><a href="https://apps.apple.com/se/app/audio-pro-control/id1187842659" target="_blank"><img alt="" src="/www/front/kcfinder-images/image-inline/HOME-apple-store.png" style="width: 150px; height: 49px;" /></a></p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<h3 style="text-align: center;">Tyto služby můžete použít přes naši aplikaci.</h3>\n\n<p>&nbsp;</p>\n\n<p style="text-align: center;"><img alt="" src="/www/fron