(13, 'Reproduktory', '<p>&nbsp;</p>\n\n<h3 style="text-align: center;">Naše chytré reproduktory vám dovolí ovládat hlasem téměř cokoliv.</h3>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/HeyGoogle-grey.png" style="width: 200px; height: 189px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><strong>“Hej Google, zahraj rock n’ roll.”</strong><br />\n&nbsp;</p>\n\n<p style="text-align: center;"><strong>“Hej&nbsp;Google, zapni&nbsp;termostat.”</strong><br />\n&nbsp;</p>\n\n<p style="text-align: center;"><strong>“Hej&nbsp;Google, jak daleko je měsíc?”</strong><br />\n&nbsp;</p>\n\n<p style="text-align: center;"><strong>“Hey Google, budu dnes potřebovat deštník?”</strong><br />\n&nbsp;</p>\n\n<p style="text-align: center;"><strong>Více o kompatibilních službách najdete zde: assistant.google.com/discover</strong></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">&nbsp;</h3>\n\n<h3 style="text-align: center;">G 10</h3>\n\n<h3 style="text-align: center;"><a href="http://www56.webrex.cz/product/15-g10-tmave-seda"><img alt="" src="/www/front/kcfinder-images/image-inline/wireless-smart-multiroom-speaker-google-assistant-chromecast-airplay2-AudioPro-Darkgrey-350x175.png" style="width: 200px; height: 100px;" /></a></h3>\n\n<p style="text-align: center;"><a href="http://www56.webrex.cz/product/15-g10-tmave-seda"><img alt="" src="/www/front/kcfinder-images/image-inline/6590.png" style="width: 80px; height: 55px;" /></a></p>\n\n<p>&nbsp;</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/alexa-blue-grey.png" style="width: 200px; height: 28px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;"><strong>Alexa, přehraj hudbu na&nbsp;Spotify.”</strong><br />\n&nbsp;</p>\n\n<p style="text-align: center;"><strong>“Alexa, zahrej Today’s Hits na&nbsp;Apple Music.”</strong><br />\n&nbsp;</p>\n\n<p style="text-align: center;"><strong>“Alexa, zahrej NPR.”</strong><br />\n&nbsp;</p>\n\n<p style="text-align: center;">&nbsp;</p>\n\n<p style="text-align: center;">&nbsp;</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">C5 Alexa</h3>\n\n<p style="text-align: center;"><a href="http://www56.webrex.cz/product/17-c5-alexa-cerna"><img alt="" src="/www/front/kcfinder-images/image-inline/smart-alexa-built-in-wireless-multiroom-speaker-C5A-AudioPro_black-350x175.png" style="width: 200px; height: 100px;" /></a></p>\n\n<p style="text-align: center;"><a href="http://www56.webrex.cz/product/17-c5-alexa-cerna"><img alt="" src="/www/front/kcfinder-images/image-inline/8390.png" style="width: 80px; height: 55px;" /></a></p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n', 140, 1, 0, '2021-07-21 14:52:18', '2021-07-21 14:52:18', NULL, 1, NULL),
