iv class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><a href="http://www56.webrex.cz/product/47-tm10-bila"><img alt="" src="/www/front/kcfinder-images/image-inline/990.png" style="width: 80px; height: 57px;" /></a></p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 150, 1, 0, '2021-07-21 14:58:15', '2021-07-21 14:58:15', NULL, 1, NULL),
(16, 'Business rozcestník', '<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/APB_grey_plugplay.png" style="width: 80px; height: 72px;" /></p>\n\n<p style="text-align: center;">&nbsp;</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/APB_grey_wireless.png" style="width: 80px; height: 80px;" /></p>\n\n<p style="text-align: center;">&nbsp;</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/APB_grey_lightsound.png" style="width: 80px; height: 80px;" /></p>\n\n<p style="text-align: center;">&nbsp;</p>\n</div>\n</div>\n</div>\n\n<div class="row row-2">\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Nezabere více než pár hodin.<br />\n&nbsp;</h3>\n\n<p style="text-align: center;">Tam, kde tradiční instalace trvá dva 2 dny,&nbsp;<br />\nzabere Audio Pro Business ne více než 2 hodiny.</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Hojně používaná wifi síť již není problémem.<br />\n&nbsp;</h3>\n\n<p style="text-align: center;">Komunikace systému běží na odlišné frekvenci&nbsp;(1.9 Ghz).</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Kde je světlo, může být také hudba.<br />\n&nbsp;</h3>\n\n<p style="text-align: center;">Jednoduše nacvakněte reproduktor do napájecí lišty vedle světla a spárujte.</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<h3 style="text-align: center;">Navrhneme vám konfiguraci pro jakýkoliv prostor - systém je naprosto flexibilní.</h3>\n\n<p>&nbsp;</p>\n\n<p><br />\n&nbsp;</p>\n', 10, 1, 0, '2021-07-21 15:08:01', '2021-07-21 15:08:01', NUL