(17, 'Podívejte se na naše vzorové realizace', '', 30, 1, 1, '2021-07-21 15:12:27', '2021-07-21 15:12:27', 'article-img/17_16286021111794.jpg', 2, 'http://www56.webrex.cz/page/10-inspirace'),
(18, 'Minimalist design', '<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<h3>&nbsp;</h3>\n\n<h3>&nbsp;</h3>\n\n<h3>&nbsp;</h3>\n\n<h3>&nbsp;</h3>\n\n<h3>&nbsp;</h3>\n\n<h3>&nbsp;</h3>\n\n<h3>&nbsp;</h3>\n\n<p><span style="font-size:26px;"><strong>Minimalistický&nbsp;design.</strong></span></p>\n\n<p style="text-align: center;">Reproduktor by měl být především slyšet a poté&nbsp;vidět.&nbsp;<br />\nTohoto názoru se drží i Audio Pro. Díky citlivému skandinávskému designu&nbsp;&nbsp;<br />\nperfektně zapadnou do interiéru vaší prodejny, restaurace či firmy.<br />\nPerfektně&nbsp;ladí při montáži do světelných lišt nebo na stěnu/strop.</p>\n</div>\n</div>\n\n<div class="col col-md-8">\n<div class="content">\n<p><img alt="" src="/www/front/kcfinder-images/image-inline/svetlo.png" style="width: 750px; height: 1197px;" /></p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h3 style="text-align: center;">Audio Pro Business je více než byste si mohli myslet.<br />\n&nbsp;</h3>\n\n<p style="text-align: center;">Audio Pro Business není jen o reproduktorech.<br />\n<br />\nJe to komplexní audio řešení pro váš byznys.</p>\n\n<p>&nbsp;</p>\n\n<p style="text-align: center;">&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/APB_grey_costeffective.png" style="width: 63px; height: 63px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/APB_grey_premiumsound.png" style="width: 63px; height: 64px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/APB_grey_multiplezones.png" style="width: 64px; height: 64px;" /></p>\n</div>\n</div>\n</div>\n\n<div class="row row-2">\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Vyplatí se</h3>\n\n<p style="text-align: center;">Rychlá instalace s možností změny pozice. A pořád stejná hudební kvalita.</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Prémiový zvuk</h3>\n\n<p style="text-align: center;">Kvalitní měniče v kombinaci se zesilovačem s&nbsp;DSP nastavením Vám nabídnou zvukový projev, který byste&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;v této cenové úrovni nečekali.</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Vytvořte si zóny</h3>\n\n<p style="text-align: center;">Využijte až šesti nezávislých zón a nastavte si úroveň hlasitosti podle vašich představ.</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/1APB_grey_flexibility.png" style="width: 63px; height: 64px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/1APB_grey_freedom.png" style="width: 64px; height: 64px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/1APB_grey_roi.png" style="width: 63px; height: 63px;" /></p>\n</div>\n</div>\n</div>\n\n<div class="row row-2">\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Flexibilita</h3>\n\n<p style="text-align: center;">Změna pozice reproduktoru je jednoduchá. Šetříte čas i peníze. Navždy.</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Nezávislost</h3>\n\n<p style="text-align: center;">Poslouchejte hudbu z jakéhokoliv zdroje. A můžete ho kdykoliv změnit.</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Vysoká přidaná hodnota</h3>\n\n<p style="text-align: center;">Za své peníze dostanete více muziky. Na úkor úspory za instalaci. No neberte to !</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/1APB_grey_sidebyside.png" style="width: 63px; height: 63px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/1APB_grey_range.png" style="width: 62px; height: 63px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/1APB_grey_design.png" style="width: 64px; height: 63px;" /></p>\n</div>\n</div>\n</div>\n\n<div class="row row-2">\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Side-by-side&nbsp;</h3>\n\n<p style="text-align: center;">S Audio Pro Business se vyhnete konfliktům běžným v přeplněných obchodních centrech a prostorách.</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Pokrytí</h3>\n\n<p style="text-align: center;">S produkty&nbsp;&nbsp;Audio Pro Business dosáhnete 2x většího pokrytí než s klasickými wifi systémy. Perfektně funguje&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;ve velkých obchodech nebo autosalonech. Vyzkoušejte si to.</p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<h3 style="text-align: center;">Skandinávský design</h3>\n\n<p style="text-align: center;">Inovace a design byly vždy vizitkou této části světa. A nejinak je tomu i u Audio Pro Business.</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h3 style="text-align: center;">Audio Pro Business využívají také:</h3>\n\n<p>&nbsp;</p>\n\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/APB-logos2.png" style="width: 800px; height: 131px;" /></p>\n\n<p style="text-align: center;"><img alt="" src="/www/front/kcfinder-images/image-inline/APB-logos1.png" style="width: 800px; height: 131px;" /></p>\n\n<p style="text-align: center;">&nbsp;</p>\n\n<h3 style="text-align: center;"><br />\n&nbsp;</h3>\n', 40, 1, 0, '2021-07-21 15:15:59', '2021-07-21 15:15:59', NULL, 1, NULL),
