(37, 'Kde můžete koupit', '<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-6">\n<div class="content">\n<h1 style="margin-left: 120px;">Kde můžu zakoupit Audio Pro?</h1>\n</div>\n</div>\n\n<div class="col col-md-6">\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n</div>\n</div>\n</div>\n\n<hr />\n<p>&nbsp;</p>\n', 10, 1, 0, '2021-07-28 09:49:39', '2021-07-28 09:49:39', NULL, 1, ''),
(38, 'Historie', '<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-3">\n<div class="content">\n<p style="text-align: right;"><span style="font-size:36px;"><strong>Náš příběh</strong></span></p>\n</div>\n</div>\n\n<div class="col col-md-9">\n<div class="content">\n<p>Před více než 40 lety jsme začali stavět aktivní reproduktory s jediným cílem — nabídnout co nejvyšší kvalitu zvuku za co nejlepší cenu. Dnes má Audio Pro prodejny ve 45 zemích na 4 kontinentech. A cíl se nezměnil.</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-6">\n<div class="content">\n<p style="text-align: right;"><a href="#story"><img alt="" src="/www/front/kcfinder-images/image-inline/pribeh.jpg" style="width: 137px; height: 50px;" /></a></p>\n</div>\n</div>\n\n<div class="col col-md-6">\n<div class="content">\n<p><a href="#fil"><img alt="" src="/www/front/kcfinder-images/image-inline/filosofie-des.jpg" style="width: 197px; height: 50px;" /></a></p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<div class="page-template-page-our-story" id="story">\n<div class="our-story-timeline" id="ourstory">\n<div class="our-story-timeline__year-top">&nbsp;</div>\n\n<div class="our-story-timeline__year-top">1978</div>\n\n<div class="our-story-timeline__line">&nbsp;</div>\n\n<ul>\n	<li class="our-story-timeline__right timeline-1">\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/1.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Kultovní reproduktor A4.14</strong>\n\n	<p>Nové a radikální řešení — 14 litrová ozvučnice se zabudovaným zesilovačem a technologií ACE-Bass, která umožňuje reprodukci hlubokých basů z malé ozvučnice.</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__left timeline-2">\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/2.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Inventor Karl-Erik Ståhl</strong> <strong>Vynálezce Karl-Erik Ståhl</strong>\n\n	<p>Konstruktér Karl-Erik Ståh stojí za mnoha patenty Audio Pro, zejména za technologií ACE-Bass.</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__right timeline-3">\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/3.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Aktivní subwoofer B2.50</strong>\n\n	<p>Když byl představen na jednom z největších audio veletrhů na světě, redaktor jednoho z nejznámějších amerických audio magazínů napsal "Dokázali jste nemožné"</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__left timeline-4">\n	<div class="our-story-timeline__year">1980</div>\n\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/4.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Aktivní minireproduktor A2.2</strong>\n\n	<p>Technologie ACE PLUS byla představena s úžasným minireproduktorem A2.2. Velikost reproduktoru se zmenšila, hluboké basy zůstaly.</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__right timeline-5">\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/5new.jpg" /></div>\n\n	<div class="our-story-timeline__text">\n	<p><strong>Pořádné basy v autě</strong></p>\n\n	<p>Subwoofer B2-07 pro auta, vybavený technologií AceBass.</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__left timeline-6">\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/6.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Audio Pro leták</strong>\n\n	<p>Přehled produktové řady z konce 80. let. Všimněte si obrovských subwooferů B4-200!</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__right timeline-7">\n	<div class="our-story-timeline__year">1990</div>\n\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/7.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Subwoofer B1.20</strong>\n\n	<p>Malý aktivní subwoofer B1.20 se sériově vyráběl téměře 20 let.</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__left timeline-8">\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/8.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Legendární podlahový reproduktor Black Diamond</strong>\n\n	<p>První verze představena v roce 1998. Švédský hi-fi magazín napsal: "Věc, kterou v hi-fi světě zažijete jednou za život".</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__right timeline-9">\n	<div class="our-story-timeline__year">2000</div>\n\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/9.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Minireproduktory Allroom</strong>\n\n	<p>Vysoce oceňované reproduktory Allroom byly vyráběny v 10 různých barevných provedení</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__left timeline-10">\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/10.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Hi-fi systém Stereo One</strong>\n\n	<p>Mini hi-fi systém s technologií ACE-bass, který stále platí za klasiku a referenci ve své třídě.</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__right timeline-11">\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/11.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Porto – přenosný dokovací reproduktor a rádio pro iPod</strong>\n\n	<p>Unikátní design a zvuk. Perfektní na pikniky!</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__left timeline-12">\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/12.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Living LV3</strong>\n\n	<p>Audio Pro uvádí bezdrátový hi-fi reproduktor Living LV3, který se brzy stává kultovním.</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__right timeline-13">\n	<div class="our-story-timeline__year">2010</div>\n\n	<div class="our-story-timeline__image"><img alt="" src="/www/front/kcfinder-images/image-inline/13.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Addon T10</strong>\n\n	<p>Základní model bezdrátové řady Addon spojující jednoduchost a prvotřídní zvuk.</p>\n	</div>\n	</li>\n	<li class="our-story-timeline__left timeline-14">\n	<div class="our-story-timeline__image">&lt;<img alt="" src="/www/front/kcfinder-images/image-inline/14.jpg" /></div>\n\n	<div class="our-story-timeline__text"><strong>Multiroom</strong>\n\n	<p>Audio Pro vstupuje na multiroom trh s celou řadou bezdrátových multiroom reproduktorů.</p>\n	</div>\n	</li>\n</ul>\n\n<div class="our-story-timeline__year-bottom">nyní</div>\n</div>\n</div>\n\n<p id="fil">&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p style="text-align: right;"><span style="font-size:36px;"><strong>Filozofie designu</strong></span></p>\n</div>\n</div>\n\n<div class="col col-md-8">\n<div class="content">\n<p>Základem Audio Pro jsou aktivní reproduktory. Od svých začátků v roce 1978 se Audio Pro<br />\nstalo synonymem pro skvělý zvuk z malých reproduktorů. To zůstává stejné, navíc, všechny<br />\nreproduktory, které děláme teď, jsou také bezdrátové.</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:36px;"><strong>Desing uvnitř i zvenku</strong></span></p>\n\n<p>Design je pro nás velmi důležitý - ať už z konstrukčního nebo z estetického pohledu. Chceme, aby design byl moderní, jednoduchý a sofistikovaný zároveň. Současný a přitom klasický. Chceme, aby si naše reproduktory oblíbilo hodně lidí, design musí projít zkouškou času. Navrhujeme reproduktory, ne vesmírné lodě.</p>\n</div>\n</div>\n\n<div class="col col-md-8">\n<div class="content">\n<p style="text-align: right;"><img alt="" src="/www/front/kcfinder-images/image-inline/block1.png" style="width: 718px; height: 1010px;" /></p>\n</div>\n</div>\n</div>\n</div>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-8">\n<div class="content">\n<p><img alt="" src="/www/front/kcfinder-images/image-inline/block2-2.jpg" style="width: 764px; height: 750px;" /></p>\n</div>\n</div>\n\n<div class="col col-md-4">\n<div class="content">\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 36px;"><b>Donutí vás vstát</b></span><br />\n<span style="font-size: 36px;"><b>ze židle!</b></span></p>\n\n<p>Navrhujeme reproduktory, které vás nechají si hudbu užít. S konstrukcí reproduktorů máme dlouholetou zkušenost a víme, že hudba by měla být nejen slyšet, ale i cítit. Hudba pro vás něco znamená, takže znamená i pro nás. Máme pro hudbu vášeň. Čas a úsilí, které dáváme do každého produktu, je znát. Rádi jsme porovnáváni a své produkty necháváme testovat. Zní to dobře? To bychom řekli a recenzenti si to myslí také.</p>\n</div>\n</div>\n</div>\n</div>\n\n<p>&nbsp;</p>\n\n<div class="btgrid">\n<div class="row row-1">\n<div class="col col-md-4">\n<div class="content">\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size: 36px;"><b>Zvuk vždy na prvním místě</b></span></p>\n\n<p>Tajemství skvělého zvuku produktů Audio Pro jsou dlouholeté zkušenosti spojené s výzkumem a vývojem, které vedou k inovativním, patentovaným technologiím, z nichž nejdůležitější je technologie ACE-Bass — náše řešení, jak dostat lepší a mohutnější basy z malých reproduktorů.</p>\n\n<p>Ale tím nejdůležitějším nástrojem jsou naše uši. Trávíme nekonečné hodiny v našich poslechových místnostech, abychom zvuk Audio Pro přivedli k dokonalosti. K tomu všichni testujeme prototypy i u sebe doma.</p>\n</div>\n</div>\n\n<div class="col col-md-8">\n<div class="content">\n<p style="text-align: right;"><img alt="" src="/www/front/kcfinder-images/image-inline/block3.png" style="width: 745px; height: 1103px;" /></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n</div>\n</div>\n</div>\n</div>\n', 10, 1, 0, '2021-09-09 12:12:54', '2021-09-09 12:12:54', NULL, 1, '');
INSERT INTO `web_articles` (`id`, `name`, `article`, `order_article`, `active`, `show_title`, `created`, `updated`, `image`, `type`, `link`) VALUES
(39, 'Obchodní podmínky a GDPR', '<p>OBCHODNÍ PODMÍNKY<br />\n1. Kontaktní údaje prodávajícího</p>\n\n<p>Název e-shopu: audio-pro.cz<br />\nProvozovatel: HIFI-GUIDE s.r.o.<br />\nSídlo/Bydliště: Slovinská 1180/52, 612 00 Brno - Královo Pole<br />\nIČ: 02417316<br />\nDIČ: CZ7301254708<br />\nTelefon: CZ02417316<br />\nEmail: info@hifi-guide.cz<br />\nČíslo CZK účtu Unicredit Bank &nbsp; &nbsp; &nbsp;1387888853/2700</p>\n\n<p>2. Informace</p>\n\n<p>Informace o zboží a ceně uváděné prodávajícím jsou závazné s výjimkou zjevné chyby. Ceny jsou prezentovány včetně všech daní (např. DPH) a poplatků, kromě nákladů na doručení zboží. Prodávající nepožaduje žádné poplatky v závislosti na způsobu platby, vyjma doběrečného.Podle zákona o evidenci tržeb je prodávající povinen vystavit kupujícímu účtenku. Zároveň je povinen zaevidovat přijatou tržbu u správce daně online; v případě technického výpadku pak nejpozději do 48 hodin.<br />\nPřijetí nabídky s dodatkem nebo odchylkou není přijetím nabídky.<br />\nPotvrzení obsahu smlouvy uzavřené v jiné než písemné formě, které vykazuje odchylky od skutečně ujednaného obsahu smlouvy, nemá právní účinky.<br />\nPřevzetí nevyžádaného plnění ze strany kupujícího neznamená přijetí nabídky.</p>\n\n<p>3. Doručování zboží</p>\n\n<p>Prodávající dodá zboží kupujícímu kompletní, nejpozději do 15 dnů od potvrzení objednávky, pokud u jednotlivého zboží neuvádí jinou lhůtu k dodání. Je-li u zboží uvedeno „skladem“, prodávající zboží odešle nejpozději do dvou pracovních dnů. Kupující je povinen zboží převzít a zaplatit. Kupujícímu se doporučuje, aby si zboží při převzetí co nejdříve překontroloval.<br />\nDoklady ke zboží, zejména daňový doklad, potvrzení a certifikáty, odešle prodávající kupujícímu ihned po převzetí zboží, nejpozději do dvou dnů od převzetí zboží spotřebitelem.<br />\nPožádá-li o to kupující, potvrdí mu prodávající v písemné formě, v jakém rozsahu a po jakou dobu trvají jeho povinnosti z vadného plnění a jakým způsobem může kupující práva z nich uplatnit.<br />\nCena a způsob doručení (informace zde)<br />\nNepřevezme-li kupující zboží v dohodnuté době porušením své povinnosti, je povinen prodávajícímu zaplatit poplatek za uskladnění za každý den prodlení ve výši 10 Kč, maximálně však 300 Kč. Prodávající je oprávněn poté, co kupujícího prokazatelně e-mailem upozorní a poskytne mu novou přiměřenou lhůtu pro převzetí, zboží vhodným způsobem prodat. Náklady na uskladnění a náklady marného dodání zboží z důvodu nedostatku součinnosti na straně kupujícího v nezbytně nutné výši je prodejce oprávněn vůči kupujícímu započíst na výtěžek prodeje.</p>\n\n<p>Kupující může odstoupit od smlouvy do 21 dnů od převzetí zboží nebo poslední části dodávky, a to bez ohledu na způsob převzetí zboží či provedení platby. Uvedená lhůta je určena k tomu, aby se kupující v přiměřeném rozsahu seznámil s povahou, vlastnostmi a funkčností zboží.</p>\n\n<p>4. Zrušení objednávky a odstoupení od smlouvy</p>\n\n<p>Kupující je oprávněn od smlouvy odstoupit i kdykoliv před dodáním zboží.<br />\nOdstoupení od smlouvy kupující prodávajícímu zašle nebo předá v 21denní lhůtě. Kupující nemusí uvádět důvod, pro který od smlouvy odstupuje. Pro usnadnění komunikace je vhodné v odstoupení uvést datum nákupu či číslo smlouvy/prodejního dokladu, bankovní spojení a zvolený způsob vrácení zboží.<br />\nProdávající je povinen kupujícímu vrátit částku plně odpovídající ceně zboží a zaplaceným nákladům na jeho dodání do 14 dnů od odstoupení od smlouvy, a to stejným způsobem, jakým platbu od kupujícího přijal. Nabízí-li prodávající v rámci určitého způsobu dodání zboží několik možností, je povinen kupujícímu nahradit nejlevnější z nich. Nejpozději ve stejné lhůtě je kupující povinen prodávajícímu zaslat nebo předat zakoupené zboží. Zboží by mělo být vráceno prodávajícímu (ne na dobírku) kompletní, nejlépe v původním obalu, nesmí jevit známky opotřebení či poškození. Náklady vrácení zboží nese kupující.<br />\nProdávající není povinen vrátit přijaté peněžní prostředky kupujícímu dříve, než mu kupující zboží předá nebo prokáže, že zboží prodávajícímu odeslal.<br />\nJe-li vrácené zboží poškozeno porušením povinností kupujícího, je prodávající oprávněn vůči kupujícímu uplatnit nárok na náhradu snížení hodnoty zboží a započíst jej na vracenou částku.<br />\nVýjimky: Právo na odstoupení od smlouvy nelze uplatnit u smluv na dodání digitálního obsahu, nebyl-li dodán na hmotném nosiči, či u smluv o poskytování služeb, v obou případech za podmínky, že ke splnění došlo s předchozím výslovným souhlasem kupujícího před uplynutím lhůty pro odstoupení od smlouvy; dále u smluv na dodávku služeb nebo zboží (včetně alkoholických nápojů), jejichž cena závisí na výchylkách finančního trhu nezávisle na vůli prodávajícího; u smluv na dodávku zboží upraveného podle přání kupujícího nebo pro jeho osobu a u smluv na zboží, které podléhá rychlé zkáze, u zboží, které bylo nenávratně smíseno s jiným zbožím, nebo vyňato z uzavřeného obalu a z hygienických důvodů je nelze vrátit; u dodávky zvukových či obrazových nahrávek nebo počítačových programů, porušil-li kupující jejich původní obal; u dodávky novin, časopisů nebo jiných periodik; u smluv o ubytování, dopravě, stravování nebo využití volného času poskytovaných v určeném termínu nebo u smluv uzavíraných na základě veřejné dražby podle zákona upravujícího veřejné dražby.</p>\n\n<p>Prodávající je oprávněn od smlouvy odstoupit kdykoliv před dodáním zboží, pokud není objektivně schopen z důvodů na straně třetích osob dodat kupujícímu zboží ve lhůtě přiměřené okolnostem a/nebo pokud vyjde najevo, že kupující porušil již dříve uzavřenou smlouvu s prodávajícím.<br />\nProdávající zároveň kupujícího upozorňuje, že smlouva není uzavřena, pokud jsou zde oprávněné pochybnosti o skutečné identitě kupujícího nebo v případě zjevných chyb v uváděných informacích o zboží nebo ceně.</p>\n\n<p>5. Práva a povinnosti z vadného plnění</p>\n\n<p>Jakost při převzetí</p>\n\n<p>Pokud má převzaté zboží nedostatky (např. nemá sjednané nebo oprávněně očekávané vlastnosti, nehodí se k obvyklému nebo sjednanému účelu, není kompletní, neodpovídá jeho množství, míra, hmotnost, nebo jakost neodpovídá jiným zákonným, smluvním nebo i předsmluvním parametrům), jedná se o vady zboží, za které prodávající odpovídá.<br />\nKupující může u prodávajícího uplatnit nejpozději do dvou let od převzetí zboží podle svého požadavku nárok na bezplatné odstranění vady nebo na přiměřenou slevu z ceny; není-li to povaze vady neúměrné (zejména nelze-li vadu odstranit bez zbytečného odkladu), lze uplatnit požadavek na dodání nové věci bez vad nebo nové součásti bez vad, týká-li se vada pouze této součásti.<br />\nNení-li oprava nebo výměna zboží možná, na základě odstoupení od smlouvy může kupující požadovat vrácení kupní ceny v plné výši.<br />\nBěhem šesti měsíců od převzetí zboží se předpokládá, že vada zboží existovala již při převzetí zboží.<br />\nProdávající není povinen nároku kupujícího vyhovět, pokud prokáže, že kupující před převzetím o vadě zboží věděl nebo ji sám způsobil.<br />\nU prodávaného použitého zboží prodávající neodpovídá za vady odpovídající míře dosavadního používání nebo opotřebení. U věcí prodávaných za nižší cenu prodávající neodpovídá za vadu, pro kterou byla nižší cena sjednána. Místo práva na výměnu má kupující v těchto případech právo na přiměřenou slevu.</p>\n\n<p>Zákonná práva z vad</p>\n\n<p>Prodávající odpovídá za vady vzniklé po převzetí zboží v 24 měsíční záruční době nebo v době použitelnosti uvedené v reklamě, na obalu zboží nebo v připojeném návodu.<br />\nV této lhůtě může kupující uplatnit reklamaci a podle své volby požadovat u vady, která znamená podstatné porušení smlouvy (bez ohledu na to, jde-li o vadu odstranitelnou či neodstranitelnou):<br />\n• odstranění vady dodáním nové věci bez vady nebo dodáním chybějící věci;<br />\n• bezplatné odstranění vady opravou;<br />\n• přiměřenou slevu z kupní ceny; nebo<br />\n• vrácení kupní ceny na základě odstoupení od smlouvy.<br />\nPodstatné je takové porušení smlouvy, o němž strana porušující smlouvu již při uzavření smlouvy věděla nebo musela vědět, že by druhá strana smlouvu neuzavřela, pokud by toto porušení předvídala.<br />\nU vady, která znamená nepodstatné porušení smlouvy (bez ohledu na to, jde-li o vadu odstranitelnou či neodstranitelnou), má kupující nárok na odstranění vady anebo přiměřenou slevu z kupní ceny.<br />\nVyskytla-li se odstranitelná vada po opravě opakovaně (třetí reklamace pro stejnou závadu nebo čtvrtá pro odlišné závady) nebo má zboží větší počet vad (nejméně tři vady současně), může kupující uplatnit právo na slevu z kupní ceny, výměnu zboží nebo odstoupit od smlouvy.<br />\nProdávající neodpovídá za vady vzniklé v důsledku běžného opotřebení nebo nedodržení návodu k použití.</p>\n\n<p>6. Vyřízení reklamace</p>\n\n<p>Kupující je povinen uplatnit reklamaci u prodávajícího nebo osoby určené k opravě bez zbytečného odkladu od zjištění nedostatku. Učiní-li tak písemně nebo elektronicky, měl by uvést své kontaktní údaje, popis závady a požadavek na způsob vyřízení reklamace.<br />\nKupující je povinen sdělit prodávajícímu, jaké právo si zvolil při oznámení vady, nebo bez zbytečného odkladu po oznámení vady. Změna volby bez souhlasu prodávajícího je možná jen tehdy, žádal-li kupující opravu vady, která se ukáže být neodstranitelná.<br />\nNezvolí-li kupující své právo z podstatného porušení smlouvy včas, má práva jako při nepodstatném porušení smlouvy.<br />\nKupující je povinen prokázat nákup zboží (nejlépe dokladem o koupi). Lhůta pro vyřízení reklamace běží od okamžiku uplatnění (oznámení) reklamace. Kupující předá či doručí zboží prodávajícímu nebo do místa určeného k opravě současně nebo následně po uplatnění reklamace. Zboží by mělo být při přepravě zabaleno ve vhodném obalu, aby nedošlo k jeho poškození, mělo by být čisté a kompletní.<br />\nProdávající je povinen bezodkladně, nejpozději do tří pracovních dnů, rozhodnout o reklamaci, případně o tom, že je k rozhodnutí potřebné odborné posouzení. Informaci o nutnosti odborného posouzení kupujícímu v této lhůtě sdělí. Reklamaci, včetně odstranění vady, prodávající vyřídí bez zbytečného odkladu, nejpozději do 30 dnů od jejího uplatnění, pokud se s kupujícím písemně nedohodnou na delší lhůtě. Po uplynutí této lhůty má kupující stejná práva, jako by se jednalo o podstatné porušení smlouvy.<br />\nOdmítne-li prodávající odstranit vadu věci, může kupující požadovat přiměřenou slevu z ceny nebo odstoupit od smlouvy.<br />\nZáruční doba se prodlužuje o dobu od uplatnění reklamace do jejího vyřízení nebo do doby, kdy byl kupující povinen si věc vyzvednout. Dojde-li k výměně zboží nebo jeho části, uplatní se odpovědnost prodávajícího jako by šlo o koupi nového zboží nebo jeho části.<br />\nNení-li umožněno sledovat stav vyřízení reklamace on-line, zavazuje se prodávající o vyřízení reklamace kupujícího informovat podle jeho požadavku e-mailovou zprávou nebo prostřednictvím SMS.<br />\nU oprávněné reklamace náleží kupujícímu náhrada účelně vynaložených nákladů.</p>\n\n<p>7. Ochrana osobních údajů</p>\n\n<p>Správcem osobních údajů poskytnutých za účelem plnění předmětu smlouvy je prodávající.</p>\n\n<p>Název e-shopu: audio-pro.cz<br />\nProvozovatel: HIFI-GUIDE s.r.o.<br />\nSídlo/Bydliště: Slovinská 1180/52, 612 00 Brno - Královo Pole<br />\nIČ: 02417316<br />\nDIČ: CZ7301254708<br />\nTelefon: CZ02417316<br />\nEmail: info@hifi-guide.cz<br />\nČíslo CZK účtu Unicredit Bank &nbsp; &nbsp; &nbsp;1387888853/2700</p>\n\n<p>Účel zpracování, rozsah osobních údajů a právní základ pro zpracování</p>\n\n<p>Kupující bere na vědomí, že pro účely uzavření kupní smlouvy, její následné plnění (zpracování objednávky, zajištění vyskladnění a doručení zboží) a případného řešení práv z vadného plnění (reklamací) správce zpracuje a uchová v souladu s nařízením Evropského parlamentu a Rady (EU) 2016/679, obecné nařízení o ochraně osobních údajů (dále jen GDPR), jeho osobní údaje v následujícím rozsahu: jméno, příjmení, adresa, e-mail a telefonní číslo (případně doplnit další údaje, které se budou zpracovávat – platební údaje atp.).</p>\n\n<p>Právním základem pro zpracování osobních údajů je v souladu s článkem 6 odst. 1 písm. b) GDPR plnění smlouvy, jejíž smluvní stranou je kupující.</p>\n\n<p>Kategorie příjemců/příjemci osobních údajů</p>\n\n<p>Správce se zavazuje osobní údaje kupujícího neposkytnout jiným subjektům než následujícím zpracovatelům:<br />\na) smluvnímu dopravci, kterého si kupující zvolí v objednávkovém formuláři, za účelem dodání zboží, přičemž údaje budou poskytnuty v následujícím rozsahu: jméno, příjmení, adresa, e-mail, telefonní číslo;<br />\nb) provozovateli portálu Heureka.cz za účelem generování a zasílání dotazníků spokojenosti s nákupem v rámci programu Ověřeno zákazníky, do něhož je internetový obchod zapojen. Právním základem pro zpracování je v tomto případě v souladu s článkem 6 odst. 1 písm. f) GDPR oprávněný zájem správce, který spočívá ve zjišťování spokojenosti kupujícího s nákupem u správce. Zasílání dotazníků se týká všech kupujících, kteří neodmítli zasílání obchodních sdělení ve smyslu § 7 odst. 3 zákona o některých službách informační společnosti (č. 480/2004 Sb.), a je prováděno po každém nákupu na internetovém obchodu. Provozovatel portálu Heureka.cz je oprávněn předanou e-mailovou adresu použít výhradně za účelem vygenerování a zaslání dotazníku spokojenosti ve smyslu Podmínek programu Ověřeno zákazníky dostupných zde: sluzby.heureka.cz/napoveda/podminky-a-dulezite-dokumenty/. Proti zasílání e-mailových dotazníků v rámci programu Ověřeno zákazníky může kupující kdykoli vyjádřit námitku odmítnutím dalších dotazníků pomocí odkazu v e-mailu s dotazníkem. V případě námitky nebude dotazník kupujícímu dále zasílán.</p>\n\n<p>Doba uložení</p>\n\n<p>Osobní údaje budou správcem uloženy po dobu nutnou ke splnění smlouvy (zpracování objednávky, vyskladnění a doručení zboží) a dále po dobu zákonné záruky (24 měsíců od převzetí zboží) či po dobu poskytnuté záruky smluvní.</p>\n\n<p>Kupující bere na vědomí, že správce má dle § 31 zákona o účetnictví (č. 593/1991 Sb.), povinnost uschovat účetní doklady a účetní záznamy (faktury) po dobu 5 let počínajících koncem účetního období, kterého se týkají (to znamená, pokud nakoupíte zboží v průběhu roku 2018, musí být faktura uchována do konce roku 2023). Správce má také povinnost vyplývající z § 47 zákona o správě daní a poplatků (č. 337/1992 Sb.) uchovat fakturu po dobu 3 let od konce zdaňovacího období, v němž vznikla daňová povinnost související s fakturou (to znamená, pokud nakoupíte zboží v průběhu roku 2018, musí být faktura pro účely daňového řízení uchována do konce roku 2021). Faktura obsahuje následující osobní údaje: jméno, příjmení a adresu.</p>\n\n<p>PRO PLÁTCE DPH:</p>\n\n<p>Kupující bere rovněž na vědomí, že správce má dle § 35 zákona o dani z přidané hodnoty (č. 235/2004 Sb.) povinnost uschovat daňové doklady po dobu 10 let od konce zdaňovacího období, ve kterém se plnění uskutečnilo (to znamená, pokud nakoupíte zboží v průběhu roku 2018, musí být faktura uchována do konce roku 2028). Daňový doklad obsahuje následující osobní údaje: jméno, příjmení a adresu.</p>\n\n<p>Práva kupujícího ve vztahu k osobním údajům</p>\n\n<p>Kupující dále bere na vědomí, že dle článků 15 až 21 GDPR má právo:<br />\na) na přístup k osobním údajům, které sestává z práva získat od správce potvrzení, zda osobní údaje, které se ho týkají, jsou či nejsou zpracovávány, a pokud je tomu tak, má právo získat přístup k těmto osobním údajům a k informacím vymezeným v článku 15 GDPR;<br />\nb) na opravu nepřesných osobních údajů, které se ho týkají, dále s přihlédnutím k účelům zpracování má kupující právo na doplnění neúplných osobních údajů, a to i poskytnutím dodatečného prohlášení dle článku 16 GDPR;<br />\nc) na výmaz („právo být zapomenut“), které spočívá v tom, že správce bez zbytečného odkladu vymaže osobní údaje, které se kupujícího týkají, jakmile již nebudou potřebné pro účely plnění smlouvy, pokud není dán jiný zákonný důvod pro jejich další zpracování;<br />\nd) na omezení zpracování osobních údajů v případech vymezených článkem 18 GDPR;<br />\ne) na přenositelnost údajů dle podmínek článku 20 GDPR;<br />\nf) vznést námitku proti zpracování osobních údajů dle článku 21 GDPR.</p>\n\n<p>Správce poskytne kupujícímu na žádost informace o přijatých opatřeních v každém případě nejpozději do jednoho měsíce od obdržení žádosti.V případě pochybností o zpracovávání osobních údajů má kupující právo se obrátit na Úřad pro ochranu osobních údajů, který je v této oblasti dozorovým orgánem, a podat k němu stížnost.</p>\n\n<p>8. Řešení sporů</p>\n\n<p>Vzájemné spory mezi prodávajícím a kupujícím řeší obecné soudy. Kupující, který je spotřebitelem, má podle zákona o ochraně spotřebitele (č. 634/1992 Sb.) právo na mimosoudní řešení spotřebitelského sporu z kupnísmlouvy nebo ze smlouvy o poskytování služeb. Subjektem, který je oprávněn mimosoudní řešení sporu provádět, je Česká obchodní inspekce. Bližší informace jsou dostupné na webových stránkách www.coi.cz. Mimosoudní řešení spotřebitelského sporu se zahajuje výlučně na návrh spotřebitele, a to pouze v případě, že se spor nepodařilo s prodávajícím<br />\nvyřešit přímo. Návrh lze podat nejpozději do 1 roku ode dne, kdy spotřebitel uplatnil své právo, které je předmětem sporu, u prodávajícího poprvé. Spotřebitel má právo zahájit mimosoudní řešení sporu online prostřednictvím platformy ODR dostupné na webové stránce ec.europa.eu/consumers/odr/. Kupující se rovněž může obrátit s žádostí o radu ohledně svých spotřebitelských práv na dTest, o.p.s. přes www.dtest.cz/poradna či na telefonu 299 149 009. Dozor nad dodržováním povinností podle zákona o ochraně spotřebitele (č. 634/1992 Sb.) vykonává (www.coi.cz).</p>\n\n<p>Tyto obchodní podmínky se řídí zákony České republiky.</p>\n', 10, 0, 0, '2023-06-02 15:48:07', '2023-06-02 15:48:07', NULL, 1, '');
